import logo1 from '../img/1.jpg'
import logo2 from '../img/2.jpg'
import logo3 from '../img/3.jpg'
import logo4 from '../img/4.jpg'

const imgdata=[

    {
        id:1,
        link:logo2
    },
    {
        id:2,
        link:logo3
    },
    {
        id:3,
        link:logo4
    },
    {
        id:4,
        link:logo1
    },
]


export default imgdata;
